import Nav from  '.Nav';
import Head from 'next/head';

function HomePage() {
    return <div>
      <Head>
      <link rel="stylesheet" href="https://stackpath.bootstrapcdn.com/bootstrap/4.5.0/css/bootstrap.min.css"></link>
      </Head>
      <Nav></Nav>
      <h1>HOMEPAGE</h1>
    </div>
  }
  
  export default HomePage
